import re

def parse_string_to_dict(s):
    key_value_pairs = s.split('')
    result_dict = {}
    for pair in key_value_pairs:
        match = re.match('\\s*(\\w+)\\s*=\\s*([\\d\\.]+)\\s*', pair)
        if match:
            result_dict[match.group(1)] = float(match.group(2)) if '.' in match.group(2) else int(match.group(2))
    return result_dict

